# 코딩테스트 문제 1"""정수 배열(int array)가 주어지면 가장 큰 이어지는 원소들의 합을 구하시오. 단, 시간복잡도는 O(n).Given an integer array, find the largest consecutive sum of elements.예제}Input: [-1, 3, -1, 5]Output: 7 // 3 + (-1) + 5Input: [-5, -3, -1]Output: -1 // -1Input: [2, 4, -2, -3, 8]Output: 9 // 2 + 4 + (-2) + (-3) + 8"""def solution(L):    li = list(set(L))    sum = 0    for i in li:        sum += i    return sumif __name__ == "__main__":    L = [2, -1, 5, 2, 8]    print(solution(L))